function getFilterString(filter){
    if(!filter) return "";
    let filterString = ""
    if(filter.From){
        filterString = "from:" + filter.From
    }
    if(filter.To){
        if(filterString) filterString = filterString + " OR ";
        filterString = filterString + "to:" + filter.To
    }
    return filterString
}

